import React from 'react';

function Pokedex(props) {
  return (
    <div>
      {props.pokemonList.map((id, name, type, image) => {
        return (<Pokemon name={name} image={image} type={type} />);
      })}
    </div>
  );
}

function Pokemon(props) {
  return (
    <div class="col-4 bg-light border rounded m-1 justify-content-center align-items-center">
      <h4 class="text-primary">{name}</h4>
      <img src={image}/>
      <h6>Type: {type}</h6>
    </div>
  );
}

export default Pokedex;
